import Card from 'react-bootstrap/Card';

function BorderExample({ nickname, content }) {
  return (
    <>
      <Card border="light" style={{ width: '18rem', boxShadow: '1px 2px 2px 0px grey',  }}>
        <Card.Header>{nickname}</Card.Header>
        <Card.Body>
          <Card.Text>
            {content}
          </Card.Text>
          <div><img src="img/check.png" alt="check"></img>
          <img src="img/delete.png" alt="check"></img></div>
        </Card.Body>
      </Card>
      <br />
    </>
  );
}

export default BorderExample;
